		function handlekeypress(e) { //פונקציה השולטת על תזוזות הצוללן על הבמה
		
		
			var getDiver = stage.getChildByName("diver"); //קבלת האובייקט הרלוונטי מהבמה
		
		
			if (e.keyCode == 37) //פעולה במקרה של בחירת מקש שמאל
			{
		
				if (getDiver.scaleX < 0) {
					getDiver.scaleX = (-1) * (getDiver.scaleX);
				}
		
				if (getDiver.x > 50) // גבול שמאלי
				{
					getDiver.x -= movment; //כל עוד לא הגיע לגבול תתבצע תנועה שמאלה
				}
			}
			if (e.keyCode == 38) //פעולה במקרה של בחירת מקש מעלה
			{
		
				if (getDiver.y > 60) // גבול עליון
				{
					getDiver.y -= movment; //כל עוד לא הגיע לגבול העליון תבצע תנועה מעלה
				}
			}
			if (e.keyCode == 39) //פעולה במקרה של בחירת מקש ימינה
			{
				if (getDiver.scaleX > 0) {
					getDiver.scaleX = (-1) * (getDiver.scaleX);
				}
		
		
				if (getDiver.x < stageMaxWidth - 50) // גבול ימין
				{
					getDiver.x += movment; //כל עוד לא גיע לגבול הימני תבצע תנועה ימינה
				}
			}
			if (e.keyCode == 40) //פעולה במקרה של בחירת מקש מטה
			{
		
				if (getDiver.y < stageMaxheight - 350) // גבול מטה
				{
					getDiver.y += movment; //כל עוד לא הגיע לגבול מטה
				}
			}
		}
		
		function tick() {
			if (cjs.Ticker.paused == false) { //האם הטיק במצב עצור
		
				for (k = 0; k < myGame.length; k++) { //רוץ בגודל המסיחים של המשחק
					var floating = stage.getChildByName("floating" + k); //קבלת האובייקט הרלוונטי מהבמה
					var answer; //צור משתנה תשובה
					if (floating != null) {
						//אם אלמנט קיים על הבמה
						if (randomRevelAnswer[k] >= floating.x) { // אם המצוף קטן או שווה למיקום שהוגרל לו בציר X
							floating.x++; //קדם את המצוף ב1
						} else { //אם המצוף נמצא מעל המספר שהוגרל לו בציר ה X
							floating.gotoAndStop(1); //התחל בפריים של מצוף בלי חבל
							if ((typeof (myGame[k][0]) === "function")) { //בודק אם התשובה היא תמונה או טקסט
								answer = stage.getChildByName("answer" + k); //קבלת האובייקט הרלוונטי מהבמה	
								floating.AnswerText.text = myGame[k][1]; //תכניס טקסט אם קיים כזה לא קיים זה ""
								floating.AnswerTextTop.text = ""; //תכניס טקסט ריק בתיבת הטקסט הגדולה
								answer.x = floating.x + 65; //קדם את צורת המסיח בהתאם
								answer.y = floating.y + 55; //קדם את צורת המסיח בהתאם
								answer.visible = true; //הראה את המסיח
							} else {
								floating.AnswerText.text = ""; //תכניס טקסט ריק בתיבת הטקטס הקטנה
								floating.AnswerTextTop.text = myGame[k][1]; //תכניס טקטס בתיבת הטקסט הגדולה
							}
							floating.y--; //תעלה את המצוף למעלה ב1
		
							var feedback; //משתנה למתן פידבק
		
							if (intersect(floating, stage.getChildByName("diver"))) { //אם קיימת אינטרקיה בין הצוללן למצוף
								feedback = check_Feedback(k, true); //מקבלת את מספר המצוף ומחזירה את הסימבול של הפידבק ובודקת אתם התשובה נכונה או שגויה
								//עצירה של הטיקר , בדיקת מערכים , עידכון מערכים , החזרת טיקר, יצירת מצוף חדש
								TimeOut_And_Remove_Folating_From_Stage(floating, answer, feedback);
		
							}
		
							if (floating.y == 30) { //אם המצוף פוגע בחלקו העליון של המסך
								feedback = check_Feedback(k, false); //מקבלת את מספר המצוף ומחזירה את הסימבול של הפידבק ובודקת אתם התשובה נכונה או שגויה
								//עצירה של הטיקר , בדיקת מערכים , עידכון מערכים , החזרת טיקר, יצירת מצוף חדש
								TimeOut_And_Remove_Folating_From_Stage(floating, answer, feedback);
							}
		
						}
					}
		
				}
			}
		
		}
		
		
		function check_Feedback(k, intrsect) {
			var feedback;
			var correctOrNotCorrectQuestion = myGame[k][2]; //מחזיק אםהתשובה נכונה או לא נכונה
			var progressBarUpdate = stage.getChildByName("target"); //קבל את אובביקט המטרה של מד ההתקדמות מהבמה
		
			if (correctOrNotCorrectQuestion == true && intrsect == true) { //אם התשובה נכונה
				answeredCorrect[k] = true; //תעדכן את המערך שהתשובה נענתה נכון
				mysound = createjs.Sound.play("correct");
				feedback = lib.great; //סימבול חיובי
				progressBarUpdate.x -= progressBarMovment;
			} else if (correctOrNotCorrectQuestion == false && intrsect == true) {
				mysound = createjs.Sound.play("incorrect");
				feedback = lib.tryAgain; //סימבול שלילי
				timeUserWrong++;
			} else if (correctOrNotCorrectQuestion == true && intrsect == false) {
				mysound = createjs.Sound.play("incorrect");
				feedback = lib.tryAgain; //סימבול שלילי
				timeUserWrong++;
			} else {
				answeredCorrect[k] = true; //תעדכן את המערך שהתשובה נענתה נכון
				mysound = createjs.Sound.play("correct");
				feedback = lib.great; //סימבול חיובי
				progressBarUpdate.x -= progressBarMovment;
			}
			return feedback;
		
		}
		//בודק אם קיימים ערכים שליליים במערך
		//מקבל מערך
		//מטרת הפונקצייה היא בדיקת סטטוס המערכים וקבלת המספרים של הערכים השליליים שנמצאים במערך
		//זה משרת אותנו לקבל מידע האם המשחק הסתיים או האם כל השאלות הוצגו לפחות פעם אחת וכולי
		function check_Array_Game_Status(array) {
			//איפס של counter
			countFalse = 0;
			for (j = 0; j < array.length; j++) { //רוץ בגודל המסיחים של המשחק
				if (array[j] == false) { //אם קיים ערך שלילי
					countFalse += 1; //תוסיף 1 COUNTER
				}
			}
			if (countFalse > 0) { //אם גדול מ 0 תחזיר true
				return false;
			}
			return true; //תחזיר אמת אם כל הערכים של המערך הם ערכים חיוביים
		
		}
