		//מפגש בין שני אלמנטים
		function intersect(obj1, obj2) {
			var diverObj2W = 60;
			var diverObj2h = 30;
			var bounyObj1H = 30;
			var obj1W = obj1.nominalBounds;
			var obj2W = obj2.nominalBounds;
		
		
			if ((obj1.x) + ((obj1W.width) / 2) <= obj2.x - ((obj2W.width) / 2)) {
				return false;
			} else if (obj1.y + ((obj1W.height - 30) / 2) <= obj2.y - ((obj2W.height + diverObj2h) / 2)) {
				return false;
			} else if ((obj1.x + 150) - ((obj1W.width) / 2) > obj2.x + ((obj2W.width) / 2)) {
				return false;
			} else if (obj1.y - ((obj1W.height + 30) / 2) > obj2.y + ((obj2W.height - diverObj2h) / 2)) {
				return false;
			}
			return true;
		}
		
		
